import React from 'react';
import Form from "react-bootstrap/Form";

class signin extends React.Component{
    constructor(){
        super()
    }


    render(){
        return(
        <Form>
          <Form.Group>
            <Form.Labelname>Name</Form.Labelname>
          </Form.Group>  
          </Form>
        )
    }
}


export default signin;
